import React from 'react';
import styled from 'styled-components';

function MenuBar() {
  return (
    <MainMenu>
      <h2>Main Menu</h2>
      <ul>
        <li>Menu Item 1</li>
        <li>Menu Item 2</li>
      </ul>
    </MainMenu>
  );
}

const MainMenu = styled.div`
  border: 1px solid black;
  border-radius: 8px;
  padding: 8px;
  margin: 16px;
  display: flex;
  flex-direction: row;
`;

export default MenuBar;
